import ice from './types/Pokemon_Ice.png';
import normal from './types/Pokemon_Normal.png';
import poison from './types/Pokemon_Poison.png';
import psychic from './types/Pokemon_Psychic.png';
import rock from './types/Pokemon_Rock.png';
import shadow from './types/Pokemon_shadow.png';
import steel from './types/Pokemon_Steel.png';
